import styled from 'styled-components';
export const Div0 = styled.div`
    width: 100%;
    height: 100vh;
    margin: 0 auto;
    overflow:auto;
    min-width: 1200px;
    background-color:blue;

`
export const DivBeside = styled.div`
    width: 15%;
    height: 100%;
    overflow:hidden;
    background-color:white;

`
